// part 1
let gamma = 0; // most common
let epsilon = 0; // least common
[...Array(12).keys()].reverse().forEach((pow, idx) => {
    let zero = 0;
    let one = 0;
    input.forEach(val => {
        if (val[idx] == 0) zero++;
        else one++;
    });
    if (one>zero) gamma += Math.pow(2,pow);
    else epsilon += Math.pow(2,pow);
});
console.log(`Part 1: ${epsilon*gamma}`);

// Part 2

// helper function
function mostCommon(values, pos){
    let ones = 0;
    let zeroes = 0;
    values.forEach(val => {
        if (val[pos] == 0) zeroes++;
        else ones++;
    });
    return zeroes > ones ? 0 : 1;
}

// cull the lists
let idx_o2 = 0;
let o2_values = input;
while (o2_values.length > 1){
    let tmp = mostCommon(o2_values, idx_o2)
    o2_values = o2_values.filter(val => val[idx_o2] == tmp);
    idx_o2++;
}
let o2_rating_arr = o2_values[0];

let idx_co2 = 0;
let co2_values = input;
while (co2_values.length > 1){
    let tmp = mostCommon(co2_values, idx_co2)
    co2_values = co2_values.filter(val => val[idx_co2] != tmp);
    idx_co2++;
}
let co2_rating_arr = co2_values[0];

// convert to decimal
let o2_rating = 0;
let co2_rating = 0;
[...Array(12).keys()].reverse().forEach((pow, idx) => {
    o2_rating += (o2_rating_arr[idx] * Math.pow(2, pow));
    co2_rating += (co2_rating_arr[idx] * Math.pow(2, pow));
});
console.log(`Part 2: ${o2_rating * co2_rating}`);